Accounts_CustomFields_Description:
ຄວນຈະມີ JSON ທີ່ຖືກຕ້ອງທີ່ມີປຸ່ມທີ່ມີຊື່ພາກສະຫນາມທີ່ມີພົດຈະນານຸກົມຂອງການຕັ້ງຄ່າພາກສະຫນາມ. ຕົວຢ່າງ: <br/><code>{
"ບົດບາດ": {
"ປະເພດ": "ເລືອກ",
"defaultValue": "ນັກຮຽນ",
"ທາງເລືອກ": ["ຄູ", "ນັກຮຽນ"],
"ຕ້ອງການ": ຄວາມຈິງ,
"modifyRecordField": {
"array": true,
"ພາກສະຫນາມ": "ພາລະບົດບາດ"
}
},
"twitter": {
"ປະເພດ": "ຂໍ້ຄວາມ",
"ຕ້ອງການ": ຄວາມຈິງ,
"minLength": 2,
"maxLength": 10
}
}</code>

